import './MenuIcon.component.scss'

export default function MenuIcon() {
    return (
        <div className="hamburger-menu">
            <svg width="31" height="30" viewBox="0 0 31 30" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M31 0.470825H0.294922V6.15695H31V0.470825Z" fill="#003049"/>
            <path d="M31 12.1569H0.294922V17.843H31V12.1569Z" fill="#003049"/>
            <path d="M31 23.843H0.294922V29.5291H31V23.843Z" fill="#003049"/>
            </svg>
        </div>
    )
}
